ojeto SPIRA-BM, que visa desenvolver Biomarcadores para problemas respiratrios usando Inteligncia Artificial em udios coletados de pacientes.  O objetivo geral  o desenvolvimento de conhecimento terico, tcnico e tecnolgico sobre biomarcadores de condies respiratrias, cuja aplicao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/","isCrawlable":true,"isLiveDvrEnabled":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/DUXAETM7oek/hqdefault.jpg? licao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/"},"lengthSeconds":"0","ownerProfileUrl":"http://www.youtube.com/@forppgcpr","externalChannelId":"UCDbzZ9YQgF77C1RI_pNx0jQ","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN w==","scrollToEngagementPanelCommand":{"targetId":"engagement-panel-structured-description"}}]}},"showLessCommand":{"clickTrackingParams":"CP4BEM2rARgBIhMI1Y_X0sjZkAMVNGe4BB0wGyMqygEEvxMSvw==","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"Ttulo: Projeto SPIRA-BM: Biomarcadores para Condies Respiratrias em Dispositivos Mveis por Anlise de udio com Inteligncia Artificial\n\nAbstract: Descreveremos nesta palestra o projeto SPIRA-BM, que visa desenvolver Biomarcadores para problemas respiratrios usando Inteligncia Artificial em udios coletados de pacientes.  O objetivo geral  o desenvolvimento de conhecimento terico, tcnico e tecnolgico sobre biomarcadores de condies respiratrias, cuja aplicao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/","commandRuns":[{"startIndex":1998,"length":32,"onTap":{"innertubeCommand":{"clickTrackingParams":"CP4BEM2rARgBIhMI1Y_X0sjZkAMVNGe4BB0wGyMqSOnD7pmTgvCiDcoBBL8TEr8=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbUNQT0FubjlROVZrTE9XazFOOXQwZlZ4NUo5QXxBQ3Jtc0traVZSZW9qVjNKMVMtdE1zV0VpUjB1NDFsb1ZGTkhWYnpyankyWmNKTHc0QVJLeEprNWloSGZJTjZVX3c3MFR4OWp6T3ZPdEFtTlFPdTM1a0tYeFY5S3k3Ny1sMk11ZmR3UHFQT01VRWNJZzFzZnpuRQ\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026v=DUXAETM7oek","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbUNQT0FubjlROVZrTE9XazFOOXQwZlZ4NUo5QXxBQ3Jtc0traVZSZW9qVjNKMVMtdE1zV0VpUjB1NDFsb1ZGTkhWYnpyankyWmNKTHc0QVJLeEprNWloSGZJTjZVX3c3MFR4OWp6T3ZPdEFtTlFPdTM1a0tYeFY5S3k3Ny1sMk11ZmR3UHFQT01VRWNJZzFzZnpuRQ\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026v=DUXAETM7oek","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":2078,"length":36,"onTap":{"innertubeCommand":{"clickTrackingParams":"CP4BEM2rARgBIhMI1Y_X0sjZkAMVNGe4BB0wGyMqSOnD7pmTgvCiDcoBBL8TEr8=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa2xaQWR5Tlh1NVRLaGdsSkQxOU84NWhNU2Jjd3xBQ3Jtc0ttRkkzaDQzQm03V3owNXpheDd6MldzRWdLeGNHX0VMNW9PU2I1V21zWTR3eVFNalJvOE5QOGlYeUtXUnRZV2ZCcGpKTVNrLTZNMUJUSkg4cTFmcndZYmRrWWFRbWZtLXRqOWExcWF1bGR0Rk5zMU50cw\u0026q=https%3A%2F%2Fadolfoneto.elixiremfoco.com%2F t":{"accessibility":{"accessibilityData":{"label":"Mostrar mais"}},"simpleText":"...mais"},"showLessText":{"simpleText":"Mostrar menos"},"attributedDescriptionBodyText":{"content":"Ttulo: Projeto SPIRA-BM: Biomarcadores para Condies Respiratrias em Dispositivos Mveis por Anlise de udio com Inteligncia Artificial\n\nAbstract: Descreveremos nesta palestra o projeto SPIRA-BM, que visa desenvolver Biomarcadores para problemas respiratrios usando Inteligncia Artificial em udios coletados de pacientes.  O objetivo geral  o desenvolvimento de conhecimento terico, tcnico e tecnolgico sobre biomarcadores de condies respiratrias, cuja aplicao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/","commandRuns":[{"startIndex":1998,"length":32,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBAQ040EGAQiEwjVj9fSyNmQAxU0Z7gEHTAbIypI6cPumZOC8KINygEEvxMSvw==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbjg3Vkg1dEtMenVTaEdOd2FIclZDaDVDdXEzUXxBQ3Jtc0trbUl6TUlsTlRzVm5abFVQR1Q1eDhqMVhlZC02aEVwRDJFMk9vZFFMQ2JFYVpWal9rYWI0d1ZscHJlalo5Y3N6S2pHTmZUN0VURE9XRVEtZHRtaHpTaW9CY0JCUnA5WGhkN2NYQWx6cGx0WVJGdjg4TQ\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026v=DUXAETM7oek","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbjg3Vkg1dEtMenVTaEdOd2FIclZDaDVDdXEzUXxBQ3Jtc0trbUl6TUlsTlRzVm5abFVQR1Q1eDhqMVhlZC02aEVwRDJFMk9vZFFMQ2JFYVpWal9rYWI0d1ZscHJlalo5Y3N6S2pHTmZUN0VURE9XRVEtZHRtaHpTaW9CY0JCUnA5WGhkN2NYQWx6cGx0WVJGdjg4TQ\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026v=DUXAETM7oek","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":2078,"length":36,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBAQ040EGAQiEwjVj9fSyNmQAxU0Z7gEHTAbIypI6cPumZOC8KINygEEvxMSvw==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbDB6N19jLUlYQTRnemZycjJYNEdIWmY0RjNiUXxBQ3Jtc0trX1RGX2xYTzNhczZoSW5FdmJMSmQtSHZjM25Ga0hMeklCTVlVckl1SUw3NzU1ZGsyLWdNSnpBNGZWNHhNZV9DOVZ6YmxDR3NKRGlxYWhvQUcwWHVpeHF4VzhZOE0xWTZWUXk4Y3BpdVlWQm0ySzIzSQ\u0026q=https%3A%2F%2Fadolfoneto.elixiremfoco.com%2F\u0026v=DUXAETM7oek","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbDB6N19jLUlYQT
